import React, { Component } from 'react';

export default class FindContactInput extends Component {
  render() {
    const { filter, onChangeFilter } = this.props;
    return (
      <div className="find-input_frame ">
        <label>
          <input
            className="input"
            type="text"
            value={filter}
            onChange={onChangeFilter}
          ></input>
        </label>
      </div>
    );
  }
}
